import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter } from "react-router-dom";
import './App.css';
import AppComponent from "./components/AppComponent";
import Switch from "react-bootstrap/Switch";


function App() {
  return (
    <div className="App">
        <Switch>
            <Route path="/"></Route>
        </Switch>
        <AppComponent/>
    </div>
  );
}

export default App;
